/// <reference types="vite/client" />

// Global compile-time constants
declare const __DEV__: boolean
declare const __BROWSER__: boolean
declare const __CI__: boolean

import antfu from '@antfu/eslint-config'

export default antfu(
  {
    vue: true,
    typescript: true,
    markdown: false,
    rules: {
      'semi': ['error', 'never'],
      'jsdoc/check-param-names': 'off',
      'jsdoc/check-tag-names': 'off',
    },
  },
  {
    ignores: [
      '*.md',
      '*.css',
      'dist/**/*',
      '.output/**/*',
      '.nuxt/**/*',
      'coverage/',
      'dist/',
      'templates/',
    ],
  },
)

{
  "extends": "./docs/.nuxt/tsconfig.json",
  "compilerOptions": {
    "target": "ESNext",
    "jsx": "preserve",
    "baseUrl": ".",
    "module": "ESNext",
    "moduleResolution": "Node",
    "paths": {
      "@vueuse/motion": [
        "./src/index"
      ],
      "@vueuse/motion/nuxt": [
        "./src/nuxt/module"
      ],
      "#app": [
        "./node_modules/nuxt/dist/app"
      ],
      "#app/*": [
        "./node_modules/nuxt/dist/app/*"
      ],
      "vue-demi": [
        "./node_modules/nuxt/dist/app/compat/vue-demi"
      ],
      "#color-mode-options": [
        "./docs/.nuxt/color-mode-options"
      ],
      "#nuxt-component-meta": [
        "./docs/.nuxt/component-meta.mjs"
      ],
      "#nuxt-component-meta/types": [
        "./docs/.nuxt/component-meta.d.ts"
      ],
      "#vue-router": [
        "./docs/.nuxt/vue-router"
      ],
      "#imports": [
        "./docs/.nuxt/imports"
      ],
      "#build": [
        "./docs/.nuxt"
      ],
      "#build/*": [
        "./docs/.nuxt/*"
      ],
      "@nuxt-themes/tokens/config": [
        "./node_modules/@nuxt-themes/tokens/dist/tokens.config.ts"
      ],
      "#pinceau/utils": [
        "./docs/.nuxt/pinceau/utils.ts"
      ],
      "#pinceau/theme": [
        "./docs/.nuxt/pinceau/index.ts"
      ],
      "#pinceau/schema": [
        "./docs/.nuxt/pinceau/schema.ts"
      ],
      "#pinceau/definitions": [
        "./docs/.nuxt/pinceau/definitions.ts"
      ],
      "#components": [
        ".nuxt/components"
      ]
    },
    "resolveJsonModule": true,
    "types": [
      "node",
      "csstype",
      "vitest",
      "vitest/globals",
      "vite/client"
    ],
    "allowJs": true,
    "strict": true,
    "noEmit": true,
    "allowSyntheticDefaultImports": true,
    "forceConsistentCasingInFileNames": true,
    "skipLibCheck": true
  },
  "include": [
    "./env.d.ts",
    "docs/**/*",
    "src/**/*",
    "tests/**/*",
    "docs/**/*",
    "playgrounds/**/*"
  ],
  "exclude": [
    "../dist",
    "../.output"
  ],
  "vueCompilerOptions": {
    "plugins": [
      "pinceau/volar"
    ]
  }
}

/// <reference types="vitest" />
import { defineConfig } from 'vite'

export default defineConfig({
  root: __dirname,
  define: {
    dev: JSON.stringify(false),
  },
  test: {
    environment: 'happy-dom',
    include: ['./tests/**/*.spec.ts'],
    // Temporarily disable `transform` test
    exclude: ['./tests/transform.spec.ts'],
  },
})
